import { TeamHelmetConfig } from "./common";

const TeamHelmetLogo = ({
  teamHelmetConfig,
  flipHelmet,
}: {
  teamHelmetConfig: TeamHelmetConfig;
  flipHelmet: boolean;
}) => {
  if (teamHelmetConfig.disableLogo) {
    return null;
  }

  const imageAttrs = {
    x: 100,
    y: 50,
    height: 180,
    width: 180,
    transform: "",
    transformMap: {
      scaleX: 1,
      scaleY: 1,
      translateX: 0,
      translateY: 0,
    },
  };

  if (
    flipHelmet &&
    (!teamHelmetConfig.flipLogoWithHelmet ||
      teamHelmetConfig.useFlippedLogoUrlWhenFlipped)
  ) {
    console.log("Flipping helmet logo");
    imageAttrs.transformMap.scaleX = -1;
    imageAttrs.transformMap.scaleY = 1;

    imageAttrs.transformMap.translateX = -380;
  }

  imageAttrs.transformMap.translateX += teamHelmetConfig.xAdjust || 0;
  imageAttrs.transformMap.translateY += teamHelmetConfig.yAdjust || 0;

  if (teamHelmetConfig.helmetLogoScale != 1) {
    imageAttrs.transformMap.scaleX *= teamHelmetConfig.helmetLogoScale || 1;
    imageAttrs.transformMap.scaleY *= teamHelmetConfig.helmetLogoScale || 1;

    const baseScaleAdjust = 1 - teamHelmetConfig.helmetLogoScale;
    const scaleAdjust =
      baseScaleAdjust >= 1 ? baseScaleAdjust : baseScaleAdjust - 1;

    imageAttrs.transformMap.translateX += (imageAttrs.width * scaleAdjust) / 2;
    imageAttrs.transformMap.translateY +=
      (imageAttrs.height * baseScaleAdjust) / 2;
  }

  imageAttrs.transform = `scale(${imageAttrs.transformMap.scaleX}, ${imageAttrs.transformMap.scaleY}) translate(${imageAttrs.transformMap.translateX}, ${imageAttrs.transformMap.translateY})`;

  const logoUrl =
    teamHelmetConfig.useFlippedLogoUrlWhenFlipped && flipHelmet
      ? teamHelmetConfig.flippedHelmetLogoUrl
      : teamHelmetConfig.helmetLogoUrl;

  console.log("TeamHelmetLogo", {
    flipLogoWithHelmet: teamHelmetConfig.flipLogoWithHelmet,
    flippedHelmetLogoUrl: teamHelmetConfig.flippedHelmetLogoUrl,
    teamHelmetConfig,
    imageAttrs,
    flipHelmet,
    logoUrl,
  });

  return (
    logoUrl && (
      <image
        href={logoUrl}
        x={imageAttrs.x}
        y={imageAttrs.y}
        height={imageAttrs.height}
        width={imageAttrs.width}
        transform={imageAttrs.transform}
      />
    )
  );
};

